import './MenuElement.css';

const MenuElement = ((props) => {
  return (
      <li className="menu-element" key={props.data.key}>
        <span className="img">ttt</span>
        <span className="text" >{props.data.title}</span>
      </li>
    )
})

export default MenuElement;

